let Footers = [
    {
      title: "Company",
      description: ["Team", "History", "Contact us", "Locations"]
    },
    {
      title: "Features",
      description: [
        "Cool stuff",
        "Random feature",
        "Team feature",
        "Developer stuff",
        "Another one"
      ]
    },
    {
      title: "Resources",
      description: [
        "Resource",
        "Resource name",
        "Another resource",
        "Final resource"
      ]
    },
    {
      title: "Legal",
      description: ["Privacy policy", "Terms of use"]
    }
  ];

  export { Footers as default};
